import React from 'react';

const Card = (props) => {
    return (
        <div className="card mb-4">
            <div className="card-header">
                {props.title}
            </div>
            <div className="card-body">
                <blockquote className="blockquote mb-0">
                <p>{props.company}.</p>
                <footer className="blockquote-footer"><a>Selengkapnya</a> || <a>Goto Job</a></footer>
                </blockquote>
            </div>
        </div>
    );
}

export default Card;
